features.script:
let misfitDoor = parcel.getFeatureById('misfitDoor');
let misfitDoorIsOpened = parcel.getFeatureById('misfitDoorIsOpened');
let misfitZombie = parcel.getFeatureById('misfitZombie');
let zombiePortal = parcel.getFeatureById('zombiePortal');

parcel.on('playerenter', (e)=> {

zombiePortal.set({'proximityToTrigger': 0.75 });

zombiePortal.on('trigger', (ee) => { 
    if(misfitDoorIsOpened._content.text == "true"){
      e.player.teleportTo("N@5856W,1794N");
    }        
});

misfitDoor.on('click', (ee) =>{
  if(misfitDoorIsOpened._content.text == "false"){
    misfitDoor.rotation.y=3.14;
    misfitDoorIsOpened.set({ text: "true"});  

    let zombieAnimation = misfitZombie.createAnimation('position');

    zombieAnimation.setKeys([{
      frame: 10,
      value: misfitZombie.position.add( new Vector3(-1,0,0) )
    }])

    misfitZombie.startAnimations( [zombieAnimation] ) //Starts the animation    
  }else{
    misfitZombie.position.set(1.57, 0.42, -4.25);  
    misfitDoor.rotation.y=1.57;
    misfitDoorIsOpened.set({ text: "false"}); 
  }

})
})
